    <div>
    <p class=MsoNormal align=center style='text-align:center'><span
    style='font-size:20.0pt;line-height:105%'>Oceanía es un continente insular
    de la Tierra constituido por la plataforma continental de Australia y los
    archipiélagos de Melanesia, Micronesia y Polinesia. Históricamente se
    consideró que Insulindia también formaba parte de Oceanía.2&#8203; Todas
    estas islas están distribuidas por el océano Pacífico. Con una extensión de
    8 542 499 km²,1&#8203; se trata del continente más pequeño del planeta
    Tierra.<o:p></o:p></span></p>
